  input: TEXT,F3A,,"This amendment was created because the original file was lost
    from the computer and the backup made was not done correctly, so there was no
    backup to go to for restoring these reports. This report was downloaded from the
    FEC webpage and all unitemized transactions were recreated.                                                                       Had
    entered incorrectly $500 twice to Tom Kelly (disbursement). One entry has now
    been removed, therefore reducing the total disbursements by $500.                             After
    re-creating this report, am not able to account for $63.43 in disbursements. Therefore,
    the total disbursements in this report is an additional $63.43 less than in previously
    filed reports, making a grand total of $563.43 less."
